import React, {useState} from 'react';

export const Steps = ({step})=> {
    const style = {
        wrap:{
            color:'black !important'
        },
        circle:{
            background:'lightgreen'
        }
    }
    return (
        <div className={'auth__steps'}>
            <div className={'auth__steps__wrapper'} style={style.wrap}>
                <span className={'auth__steps__wrapper__circle'} style={`${style.circle} ${style.wrap}`}>1</span><span>Шаг 1</span>
            </div>
            <div className={'auth__steps__wrapper'}>
                <span className={'auth__steps__wrapper__circle'}>2</span><span>Шаг 2</span>
            </div>
            <div className={'auth__steps__wrapper'}>
                <span className={'auth__steps__wrapper__circle'}>3</span><span>Шаг 3</span>
            </div>
        </div>
    );
}
